import { Link } from "react-router-dom";

function Navbar(){
    return(
        <div className="flex items-center p-3">
            <i class ="fa-brands fa-imdb"></i>
            {/* this is a commetn */}
            
            <Link to={"/"} 
            className="text-3xl mx-6 font-bold text-white hover:cursor-pointer">
                Movies
            </Link>
            <Link to={"/watchlist"} className="mx-6 text-3xl font-bold text-white hover:cursor-pointer">WatchList</Link>
        </div>
    )
}

export default Navbar;
